description:
 Brian J. Sharkey, Brian J. Physiology of Fitness Sharkey, &quot;Fitness and Health, 4Th Ed&quot;
English | ISBN: 0873228782 | 1996 | EPUB | 416 pages | 5,1 MB

Author Brian Sharkey -- past president of the American College of Sports Medicine and a world-renowned fitness authority -- explains in plain English how the body responds to physical activity, why physical activity is so important to health, and how best to become physically active.
